let startRowNumber = 2;

// Сортировка сообщений по дате (от старых к новым)
items.sort((a, b) => {
  return new Date(a.json.timestamp).getTime() - new Date(b.json.timestamp).getTime();
});

return items.map((item, index) => {
  // Преобразование timestamp в формат dd.mm.yyyy hh:mm
  const date = new Date(item.json.timestamp);
  const day = ("0" + date.getDate()).slice(-2);
  const month = ("0" + (date.getMonth() + 1)).slice(-2);
  const year = date.getFullYear();
  const hours = ("0" + date.getHours()).slice(-2);
  const minutes = ("0" + date.getMinutes()).slice(-2);
  const formattedDate = `${day}.${month}.${year} ${hours}:${minutes}`;

  return {
    json: {
      row_number: startRowNumber + index,
      message: item.json.content,
      timestamp: formattedDate,
      author: item.json.author.username,
    }
  };
});

